return(
    <div style={card} >
            <img src={ img} width="100%" height="300px" />
            <h6>{ id}</h6>
            <h2>{ name[0]} </h2>
            <p>Is Available for Joining : { isCapable?"YES":"NO"}</p>
            <h3>{ gender}</h3>

